<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css" rel="stylesheet">
    <title>2FA Authenticator</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #0a0a0a;
            color: #fff;
            min-height: 100vh;
            padding: 40px 20px;
        }

        .container {
            max-width: 480px;
            margin: 0 auto;
        }

        .header {
            margin-bottom: 40px;
        }

        .header h1 {
            font-size: 24px;
            font-weight: 600;
            margin-bottom: 6px;
        }

        .header p {
            color: #888;
            font-size: 14px;
        }

        .login-screen {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: #0a0a0a;
            display: flex;
            align-items: center;
            justify-content: center;
            z-index: 1000;
        }

        .login-box {
            text-align: center;
            max-width: 320px;
            width: 100%;
            padding: 20px;
        }

        .login-box h2 {
            font-size: 20px;
            margin-bottom: 30px;
            font-weight: 500;
        }

        input {
            width: 100%;
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            color: #fff;
            padding: 14px 16px;
            border-radius: 8px;
            font-size: 15px;
            margin-bottom: 12px;
            transition: all 0.2s;
        }

        input:focus {
            outline: none;
            border-color: #fff;
        }

        input::placeholder {
            color: #666;
        }

        .btn {
            width: 100%;
            background: #fff;
            color: #000;
            border: none;
            padding: 14px;
            border-radius: 8px;
            font-size: 15px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s;
        }

        .btn:hover {
            background: #e0e0e0;
        }

        .btn:active {
            transform: scale(0.98);
        }

        .btn-secondary {
            background: #1a1a1a;
            color: #fff;
            border: 1px solid #2a2a2a;
            margin-top: 8px;
        }

        .btn-secondary:hover {
            background: #2a2a2a;
        }

        .add-section {
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            border-radius: 12px;
            padding: 20px;
            margin-bottom: 24px;
        }

        .add-section h2 {
            font-size: 16px;
            font-weight: 500;
            margin-bottom: 16px;
        }

        .input-group {
            margin-bottom: 12px;
        }

        .input-group label {
            display: block;
            font-size: 13px;
            color: #888;
            margin-bottom: 6px;
        }

        .accounts-grid {
            display: grid;
            gap: 12px;
        }

        .account-card {
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            border-radius: 12px;
            padding: 20px;
            position: relative;
        }

        .account-header {
            display: flex;
            justify-content: space-between;
            align-items: flex-start;
            margin-bottom: 16px;
        }

        .account-info h3 {
            font-size: 15px;
            font-weight: 500;
            margin-bottom: 4px;
        }

        .account-info span {
            font-size: 13px;
            color: #666;
        }

        .delete-btn {
            background: none;
            border: none;
            color: #666;
            cursor: pointer;
            font-size: 18px;
            padding: 0;
            width: 24px;
            height: 24px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 4px;
            transition: all 0.2s;
        }

        .delete-btn:hover {
            background: #2a2a2a;
            color: #fff;
        }

        .code-section {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .code {
            display: inline-flex; /* inline 요소에 flex 적용 */
            align-items: center;
            font-size: 28px;
            font-weight: 600;
            font-family: 'SF Mono', 'Monaco', monospace;
            letter-spacing: 4px;
            gap: 6px; /* 숫자와 아이콘 사이 간격 */
        }

        .timer-circle {
            width: 36px;
            height: 36px;
            position: relative;
        }

        .timer-text {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 13px;
            font-weight: 600;
        }

        .timer-circle svg {
            transform: rotate(-90deg);
        }

        .timer-circle circle {
            fill: none;
            stroke: #2a2a2a;
            stroke-width: 3;
        }

        .timer-circle .progress {
            stroke: #fff;
            stroke-linecap: round;
            transition: stroke-dashoffset 1s linear;
        }

        .timer-circle.warning .progress {
            stroke: #ff4444;
        }

        .empty-state {
            text-align: center;
            padding: 60px 20px;
            color: #666;
        }

        .actions {
            display: flex;
            gap: 8px;
            margin-top: 16px;
        }

        .actions button {
            flex: 1;
            padding: 12px;
            font-size: 14px;
        }

        .hint {
            font-size: 12px;
            color: #666;
            margin-top: 8px;
            line-height: 1.5;
        }

        .lock-btn {
            position: fixed;
            bottom: 24px;
            right: 24px;
            width: 48px;
            height: 48px;
            border-radius: 50%;
            background: #1a1a1a;
            border: 1px solid #2a2a2a;
            color: #fff;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            font-size: 20px;
            transition: all 0.2s;
        }

        .lock-btn:hover {
            background: #2a2a2a;
        }

        #importFile {
            display: none;
        }

        .copy-feedback {
        margin-left: 4px;
        background: #4caf50;
        color: white;
        padding: 2px 4px;
        border-radius: 4px;
        font-size: 12px;
        opacity: 0;
        transition: opacity 0.3s;
        pointer-events: none;
        user-select: none;
        display: inline-block;
        }

        .copy-feedback.show {
        opacity: 1;
        }
    </style>
</head>
<body>
    <div id="loginScreen" class="login-screen">
        <div class="login-box">
            <h2>🔐</h2>
            <input type="password" id="passwordInput" placeholder="마스터 비밀번호" onkeypress="if(event.key==='Enter') login()">
            <button class="btn" onclick="login()">잠금 해제</button>
            <button class="btn btn-secondary" onclick="document.getElementById('importFile').click()">백업 파일 불러오기</button>
            <input type="file" id="importFile" accept=".enc" onchange="importData(event)">
        </div>
    </div>

    <div id="importScreen" class="login-screen" style="display: none;">
        <div class="login-box">
            <h2>🔓</h2>
            <p style="color: #888; margin-bottom: 20px; font-size: 14px;">백업 파일의 비밀번호</p>
            <input type="password" id="importPasswordInput" placeholder="비밀번호" onkeypress="if(event.key==='Enter') confirmImport()">
            <button class="btn" onclick="confirmImport()">확인</button>
            <button class="btn btn-secondary" onclick="cancelImport()">취소</button>
        </div>
    </div>

    <div id="mainApp" style="display: none;">
        <div class="container">
            <div class="header">
                <h1>Authenticator</h1>
                <p>암호화된 2단계 인증</p>
            </div>

            <div class="add-section">
                <h2>+ 계정 추가</h2>
                <div class="input-group">
                    <input type="text" id="accountName" placeholder="계정 이름 (예: Google)">
                </div>
                <div class="input-group">
                    <input type="text" id="issuer" placeholder="이메일 (선택)">
                </div>
                <div class="input-group">
                    <input type="text" id="secretKey" placeholder="비밀 키">
                </div>
                <button class="btn" onclick="addAccount()">추가</button>
                <div class="hint">💡 QR 코드 대신 "수동 입력" 옵션을 선택하면 비밀 키를 볼 수 있습니다</div>
            </div>

            <div id="accountsList" class="accounts-grid">
                <div class="empty-state">
                    <div style="font-size: 48px; margin-bottom: 12px;">🔒</div>
                    <p>등록된 계정이 없습니다</p>
                </div>
            </div>

            <div class="actions">
                <button class="btn btn-secondary" onclick="exportData()">백업 저장</button>
            </div>
        </div>

        <button class="lock-btn" onclick="lock()" title="잠금">🔒</button>
    </div>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/crypto-js/4.1.1/crypto-js.min.js"></script>
